El poema es un soneto de Bartolomé Cairasco de Figueroa, un poeta canario del siglo XVI, conocido por su obra en español y por ser uno de los autores más importantes de la literatura canaria de su época. El poema hace referencia a Canarias (Gran Canaria) y utiliza la metáfora del pájaro canario para expresar su admiración.
